package calculator;

public class calculatorImpl implements calculatorInterface {

	@Override
	public double calculateAdd(double A, double b) {
		// TODO Auto-generated method stub
		return A+b;
	}

	@Override
	public double calculateSub(double A, double b) {
		// TODO Auto-generated method stub
		return A-b;
	}

	@Override
	public double calculateMul(double A, double b) {
		// TODO Auto-generated method stub
		return A*b;
	}

	@Override
	public double calculatediv(double A, double b) {
		// TODO Auto-generated method stub
		return A/b;
	}
	

}
